sub new {
    my $class = shift;
    my $self = {
    };
    bless ($self, $class);
    return $self;
}

sub geodata {
  my $self = shift;
  $self->{geodata} = $_[0] if defined $_[0];
  return $self->{geodata};
}

sub geocode {
  my $self    = shift;
  my %params = @_;
	my $lat = $params{lat} if defined $params{lat};
	my $lon = $params{lon} if defined $params{lon};
	my $el = $params{el} if defined $params{el};
	my $code = uc $params{gc} if defined $params{gc}; #Geo::Code::XYZ is case insensitive
	my $geo3name = $params{geoname} if defined $params{geoname};
	if (defined $lat && defined $lon) {
	if ($geo3name) {
	  $self->ngcode($lat,$lon,$geo3name,$el);
	} else {
	  $self->gcode($lat,$lon);
	}
	} else {
	  $self->gll($code);
	}
	  my $geodata    = $self->geodata;
	  return $self->geodata;
}

sub gcode {
  my $self        = shift;
  my ($lat,$lon) = @_;
  my $geodata = &lltodec($lat,$lon);
  return $self->geodata($geodata);
}

sub gll {
	my $self        = shift;
	my $code = shift;
	my $geodata = &dencd($code);
	return $self->geodata($geodata);
}

sub ngcode {
  my $self        = shift;
  my ($lat,$lon,$geo3name,$el) = @_;
  my $geodata = &lltodec($lat,$lon,$geo3name,$el);
  return $self->geodata($geodata);
}



sub nencd {
        my $decll = shift;
	my $elcode = shift;
	my $flagel = shift;
        my $base = Math::BigInt->new(BASEN);
        my $j=0;
        my %rems;
        my %divs;

	my $num = Math::BigInt->new($decll);
	my ($dig,$rem) = $num->bdiv($base);
 

        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
		my $dec = Math::BigInt->new($decll);
		$dec->bsub($rem);  
		$dec->bdiv($base); 
		$decll = $dec;
		my $num2 = Math::BigInt->new($decll);
		($dig,$rem) = $num2->bdiv($base);
		last if $j>13;
        }
        $rems{$j} = $rem;
        $divs{$j} = $dig;
        my $maxi = 0;
        foreach (sort {$b <=> $a} keys %rems) {
                if ($enc) {
			$enc .= '-'.GEONAMETRIPLE->[$rems{$_}];
                } else {
			$enc = GEONAMETRIPLE->[$rems{$_}];
                }
                $maxi++;
        }

if ($elcode) {
	if ($elcode ne "A") {
		my ($one,$two,$thre);
		my @a = split(//,$elcode);
		$thre = pop @a;
		$two = pop @a;
		$one = pop @a;
		my ($g1,$g2,$g3) = split(/\-/,$enc);
		if ($flagel eq "-") {

                my $l = substr($g3,0,1);
                if ($vowel{$l} && $vowel{$thre}) {
                        $g3 = $thre . 'L' . $g3;
                } elsif (($vowel{$l} && ! $vowel{$thre}) || (! $vowel{$l} && $vowel{$thre})) {
                        $g3 = $thre . $g3;
                } else {
                        $g3 = $thre . 'E' . $g3;
                }       
                if ($two ) {
                        my $l = substr($g2,0,1);
                        if ($vowel{$l} && $vowel{$two}) {
                                $g2 = $two . 'L' . $g2;
                        } elsif (($vowel{$l} && ! $vowel{$two}) || (! $vowel{$l} && $vowel{$two})) {
                                $g2 = $two . $g2; 
                        } else {
                                $g2 = $two . 'E'. $g2;
                        }       
                }       
                if ($one ) {
                        my $l = substr($g1,0,1);
                        if ($vowel{$l} && $vowel{$one}) {
                                $g1 = $one . 'L' . $g1;
                        } elsif (($vowel{$l} && ! $vowel{$one}) || (! $vowel{$l} && $vowel{$one})) {
                                $g1 = $one . $g1; 
                        } else {
                                $g1 = $one . 'E' . $g1;
                        }       
                }       


		} else {
		my $l = substr($g3,-1);
		if ($vowel{$l} && $vowel{$thre}) {
			$g3 .= 'L' . $thre;
		} elsif (($vowel{$l} && ! $vowel{$thre}) || (! $vowel{$l} && $vowel{$thre})) {
			$g3 .= $thre;
                } else {
			$g3 .= 'E' . $thre;
		}
		if ($two ) {
		        my $l = substr($g2,-1);
                	if ($vowel{$l} && $vowel{$two}) {
                	        $g2 .= 'L' . $two;
                	} elsif (($vowel{$l} && ! $vowel{$two}) || (! $vowel{$l} && $vowel{$two})) {
                        	$g2 .= $two;
                	} else {
                        	$g2 .= 'E' . $two;
                	}
		}
		if ($one ) {
                        my $l = substr($g1,-1);
                        if ($vowel{$l} && $vowel{$one}) {
                                $g1 .= 'L' . $one;
                        } elsif (($vowel{$l} && ! $vowel{$one}) || (! $vowel{$l} && $vowel{$one})) {
                                $g1 .= $one;
                        } else {
                                $g1 .= 'E' . $one;
                        }
                }
		}
		$enc = "$g1-$g2-$g3";
	}
}

        return $enc;
}


