                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
                last if $j>3;
        }
        $rems{$j} = $rem;
        $divs{$j} = $dig; 
        foreach (sort {$b <=> $a} keys %rems) {
                if ($enc) {
                        $enc .= ''.ALPHA->[$rems{$_}];
                } else {
                        $enc = ALPHA->[$rems{$_}];
                }
        }
        return $enc;
}


